	<script>
			
window.addEventListener('DOMContentLoaded', () => {
  fetch('vsa.json')
    .then(r => r.json())
    .then(data => {
      // store only the listings
      window.units = data.listings;

      for (const id in data.listings) {
        const unit = data.listings[id];
        const shape = document.getElementById(id);

        if (shape) {
          const status = (unit["Unit Status"] || '').toLowerCase();
         	if (status === "available") shape.classList.add("available");
         	if (status === "sold") shape.classList.add("sold");
         	if (status === "reserved") shape.classList.add("reserved");
			if (status === "close inventory") shape.classList.add("close-inventory");

          shape.addEventListener("click", () => showUnit(id));
        }
      }
    })
    .catch(err => console.error('Failed to load mf4.json:', err));

  function showUnit(id) {
    const u = window.units && window.units[id];
    if (!u) {
      alert("No data found for " + id);
      return;
    }
const status = u["Unit Status"] ?? "N/A";
const phase = u["Phase (Lot Only)"] ?? "N/A";
const unitId = u["Unit ID"] ?? "N/A";
const productType = u["Product Type"] ?? "N/A";
const lotArea = u["Lot Area (Lot Only)"] ?? "N/A";
const tcpLotOnly = u["Total Contract Price (Lot Only)"] ?? "N/A";
const dpTermsLotOnly = u["DP Terms (Lot Only)"] ?? "N/A";
const totalSellingLotOnly = u["Total Selling Price (Lot Only)"] ?? "N/A";
const vatLotOnly = u["VAT (12%) (Lot Only)"] ?? "N/A";
const lmfLotOnly = u["LMF (10%) (Lot Only)"] ?? "N/A";
const totalDpLessReservationLotOnly = u["Total Downpayment Less Reservation (Lot Only)"] ?? "N/A";
const monthlyEquityLotOnly = u["Monthly Equity (Lot Only)"] ?? "N/A";
const reservationFeeLotOnly = u["Reservation Fee (Lot Only)"] ?? "N/A";
const loanableBalanceLotOnly = u["Loanable Amount (Balance) (Lot Only)"] ?? "N/A";
const estimatedMriLotOnly = u["Estimated MRI & FI (Lot Only)"] ?? "N/A";
const ma15yrsLotOnly = u["MA 15yrs (8.5% EIR) (Lot Only)"] ?? "N/A";
const ma20yrsLotOnly = u["MA 20yrs (8.5% EIR) (Lot Only)"] ?? "N/A";
const displayName = u["Display Name"] ?? unitId;

alert(
`Unit: ${unitId}
‚Ä¢ Status: ${status}
‚Ä¢ Phase (Lot Only): ${phase}
‚Ä¢ Product Type: ${productType}
‚Ä¢ Lot Area (Lot Only): ${lotArea}
‚Ä¢ Total Contract Price (Lot Only): ${tcpLotOnly}
‚Ä¢ DP Terms (Lot Only): ${dpTermsLotOnly}
‚Ä¢ Total Selling Price (Lot Only): ${totalSellingLotOnly}

‚Ä¢ LMF (10%) (Lot Only): ${lmfLotOnly}
‚Ä¢ Total Downpayment Less Reservation (Lot Only): ${totalDpLessReservationLotOnly}
‚Ä¢ Monthly Equity (Lot Only): ${monthlyEquityLotOnly}

‚Ä¢ MA 20yrs (8.5% EIR) (Lot Only): ${ma20yrsLotOnly}
‚Ä¢ Display Name: ${displayName}`
);
  }
});
